import { useState } from "react";
import React from "react";
import uuid from "react-uuid";

function App() {
   const [counter, setCounter] = useState(0);
   const [logs, setLogs] = useState([]);
   function plus() {
      const newCounter = counter + 1;
      setCounter(newCounter);
      setLogs([
         ...logs,
         { value: newCounter, lastValue: counter, action: "plus" },
      ]);
   }
   function minus() {
      const newCounter = counter - 1;
      setCounter(newCounter);
      setLogs([
         ...logs,
         { value: newCounter, lastValue: counter, action: "minus" },
      ]);
   }
   return <div></div>;
}

export default App;
